import { Routes, Route } from "react-router-dom";
import Bookings from "./pages/Bookings";
import Home from "./pages/Home";
import Homehoc from "./HOC/Homehoc";
import "./style.css";
function App() {
  return (
    <div className="App">
      <Routes>
        <Route
          path="/"
          element={() => {
            return (
              <HomeHoc>
                <Home />
              </HomeHoc>
            );
          }}
        ></Route>
        <Route
          path="/bookings"
          element={() => {
            return (
              <Homehoc>
                <Bookings />
              </Homehoc>
            );
          }}
        ></Route>
      </Routes>
    </div>
  );
}

export default App;
